import React from 'react';
import '../Style/UserIcon.css';
import Ikun from '../Assets/ikun.png';
import arrowDown from '../Assets/arrow-down.png';

export default function UserIcon() {
  return (
    <div class="container">
        <img src={Ikun} alt="Image" class="userIcon" />
        <div class="dropdown">
            <img src={arrowDown} />
            <ul>
                <li>a</li>
                <li>b</li>
                <li>c</li>
            </ul>
        </div>
    </div>

  )
}
